real CECRotatedExpScaffers::getGap(){
	return fabs(bestValue - minValue);
}

bool CECRotatedExpScaffers::isNearOptimum(real fBest){
	real deltaValue =	fabs(fBest - minValue);
	real equation;
	
	equation = fabs(minValue*0.0001 + 0.000001);	

	//printf("\tEquation = %lf - DeltaValue = %lf \n", equation, deltaValue);		
	if ((deltaValue < equation) || (Util::equals(deltaValue, equation))){
		return true;
	} 

	return false;
}

real *CECRotatedExpScaffers::calcZ(real *x){
	real *z = new real[n];
	int i, t;

	for (i = 0; i < n; i++){
		z[i] = 0.0;		
		for (t = 0; t < n; t++){
			z[i] += (x[t]-o[t])*M[t][i]; 	
		}	
	}

	return z;
}

real CECRotatedExpScaffers::calcF(real a, real b){
	real a2 = pow(a,2);
	real b2 = pow(b,2);

	real num = pow(sin(sqrt(a2+b2)), 2) - 0.5;
	real den = pow(1.0 + 0.001*(a2+b2), 2);
	return (0.5+(num/den));
}

real CECRotatedExpScaffers::calc(real *x){
	cont++;  
	real *z;	
	real value, sum1=0;
	int i;

	z = calcZ(x); 
	for (i = 0; i < n-1; i++){
		sum1 += calcF(z[i], z[i+1]);			
	}
	
	value = sum1 + calcF(z[n-1], z[0]) - 300;

	delete []z;
	//printf("Fim... \n");	
	
	return value;
}


